import React from 'react'

const Header = () => {
    return(
        <React.Fragment>
            <header className="header">
                <strong>Torenos ATP hasta 2017</strong>
                <p>El Grand Slam de tenis está constituido por los cuatro torneos
                mayores del circuito internacional organizados por la Federación
                Internacional de Tenis.</p>
            </header>
        </React.Fragment>
    )
}
export default Header;
